import React from "react"

import projectData from "../portfolio_data/projectData"
import Project from "./Project"

class HtmlObject{
    constructor(container, h2, p, icon, ul, pos){
        this.container = container;
        this.h2 = h2;
        this.p = p;
        this.icon = icon;
        this.ul = ul;
        this.pos = pos;
    }
}

function MainContentPortfolio(){
    let i = 0;
    const myProjects = projectData.map(function(data){
        let container, h2, p, icon, pos, ul;
        if(i%2 == 0){
            container = "container_gray"
            h2 = "h2_left"
            p = "p_left"
            icon = "icon_left"
            ul = "ul_left"
            pos = "l"
        }
        else{
            container = "container_white"
            h2 = "h2_right"
            p = "p_right"
            icon = "icon_right"
            ul = "ul_right"
            pos = "r"
        }
        i++;
        return <Project key={data.id} project={data} container={container} h2={h2} p={p} icon={icon} pos={pos} ul={ul}/>
    })

    return (
        myProjects
    )
}

export default MainContentPortfolio
